import React from 'react';

const ErrorList = ({ errors, onSelectError }) => {
    return (
        <ul>
            {errors && errors.map((error, index) => (
                <li key={index} onClick={() => onSelectError(error)} className="cursor-pointer hover:bg-gray-200 py-2 px-2">
                    {error.help} {/* Le titre de l'erreur */}
                </li>
            ))}
        </ul>
    );
};

export default ErrorList;
